import React, { useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { __GetAllUsers } from '../services/UserServices';

// services


const useStyles = makeStyles((theme) => ({
    root: {
        border: '1px solid red',
        height: '100vh',
        width: '100vw',
        textAlign: 'center',
    },
}))


const GetUsers = () => {
    const classes = useStyles();
    // states that are going to be used
    const [users, setUsers] = useState([]);

    // load users
    useEffect(async () => {
        // console.log('loads first: ');
        try {
            console.log('inside try')
            const data = await __GetAllUsers();
            // console.log('after getting request: ', data);
            setUsers([...data])
            console.log('state after request: ', users);
        } catch (error) {
            throw error
        }
    }, [])

    return (
        <div className={classes.root}>
            <h1>All Users</h1>
            {/* {users.map((user) => {
                <h2>{user.firstName} {user.lastName}, {user.role}</h2>
            })} */}
        </div>
    )
}

export default GetUsers;
